  [],\n\t\"revision_timestamp\": \"2016-07-27T22:21:43.603432\",\n\t\"name\": \"monthly-report-april-lower-souris-migratory-waterfowl-refuge\",\n\t\"isopen\":
  false,\n\t\"url\": null,\n\t\"notes\": \"The Lower Souris Migratory Waterfowl Refuge
  (now known as the J. Clark Salyer National Wildlife Refuge) is located just south
  of the Canadian border in North Dakota. The refuge was established and constructed
  by the CCC in 1935 to restore waterfowl habitat. This report gives an overview of
  events taking place on the refuge in April of 1936. After much preparation and anticipation
  the marshes were flooded in this month. As a result, for the first time in five
  months ducks returned to the refuge. Migration data of birds was collected and recorded
  in data tables found in this report. Planting of waterfowl food continued and planting
  stock was stored. Preparation for wildlife research began for a crow-duck relationship
  study to be conducted by the Biological Survey. Other projects included the cleanup
  of the camp and flooding. Photographs conclude this narrative.\",\n\t\"license_title\":
